import React, { Component } from 'react';


class Home extends Component {
    constructor(){
        super(props);
        this.state ={foodItemDetails :[]}
        //u can call from here also
        // this.itemsList();
    }
    //called when component gets mounted means started .
    componentDidMount() {
        this.itemsList();
      }   
    // Get the list of food items 
    // can be use axios for api /ajax calls
    itemsList() {
        $.getJSON('https://demo6977951.mockable.io/items/get')
          .then(({ results }) => this.setState({ foodItemDetails: results }));
      } 
    render() {
        return (
            <div className="container-fluid">
                <div className="row">
                    <div className="col-sm-12 col-md-12 col-lg-12">
                        <div className="row justify-content-md-center">
                            <div className="panel panel-primary">
                                <div className="panel-body">
                                    <div className="col-sm-6 col-md-6 col-lg-6">
                                        <div className="panel panel-primary">
                                            <div className="panel-body">
                                                <div className="panel-heading">
                                                    <div className="container-fluid">
                                                        <div className="row justify-content-md-center">
                                                            <h2 className="text-center">Menu Items</h2>
                                                        </div>
                                                        <div className="row justify-content-md-center">

                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="col-sm-6 col-md-6 col-lg-6">
                                        <div className="panel panel-primary">
                                            <div className="panel-body">
                                                <div className="panel-heading">
                                                    <div className="container-fluid">
                                                        <div className="row justify-content-md-center">
                                                            <h2 className="text-center">Item Details</h2>
                                                        </div>
                                                        <div className="row justify-content-md-center">
                                                            <div className="card-body">

                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="row ">
                                    <div className="col-sm-6 col-lg-6 col-sm-offset-1">
                                        <label className="h1 control-label">Total Items:</label>
                                    </div>
                                    <div className="col-sm-4 col-lg-4 ">
                                        <label className="h1 control-label">Total Checkout Items:</label>
                                    </div>
                                </div>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
